Pour l'appel à l'API ProxCite.

Erreur sur le code commune renvoyé à l'API par exemple quand le user est créé sur bordeaux : appel envoyé :

{"envelope":{"header":{"euser":"3","ecollectivite":"241300391","elistecontrat":["2915","12923"],"elistecommune":[]},"payload":{"idContact":"00311000011FoAoAAK","eMail":"fdfdsq@yopmail.com","firstName":"fdsqfds","lastName":"fdfsfds","phone":"00","commune":243100518,"salutation":"mr"}}}


-          ITVDAY/RECITV (V05)

-          ITVDAY/STAITV (V04)


Dans le payload du json, vous devez ajouter l’élément suivant


      "inseeRestrictionTable":
      [
          {
          "restrictionIdContract":"9988",
          "restrictionIdInseeList":["18163"]
          },
          {
          "restrictionIdContract":"16404",
          "restrictionIdInseeList":[]
          }
      ]


On supprime elistecontrat, elistecommune, et elistecollectivite du header de l'enveloppe

```
height: xxx px;
overflow-y: scroll;
```
